import Foto from '../static/FotoLuisBrito.jpg';
const PersonalData = () => (

        <div className="container">
            <div className="image">
                <img  src={Foto}></img>
            </div>

            <div className="datos">
                <ul>
                    <li>Nombre: Luis Manuel</li>
                    <li>Apellido: Brito Romero</li>
                    <li>Telefono: +58 414 092.96.37</li>
                    <li>Direccion: Charallave -Edo. Miranda</li>
                    <li>Email: lsbrt4@gmail.com</li>
                </ul>
            </div>
            <div className="abstract">
                <p>lorem ipsum</p>
            </div>
       
        
            <style jsx> {`
            .container{
                width:100%;
                grid-gap: 10px;
                border: 1px solid blue;
                background-color: gray;
                display: grid;
                grid-template-columns: repeat(auto-fill, minmax(480px, 1fr) );
            }
            .datos{
                text-align: center;
                border: 1px solid black;
                padding: 20px;
                width: 100%;
                grid-column: auto;
                font-size: 22px;
                justify-content: left;
            }
            .datos ul{
                list-style-type: none;
                margin: 0;
                padding: 0;
            }
            .image{
                display: block;
                margin-left: auto;
                margin-right: auto;
                width: 40%;
            }

            .image img{
                width: 250px;
                border-radius: 50%;  
                align: center;    
            }

            .abstract{
                text-align: center;
                border: 1px solid black;
                padding: 20px;
                width: 100%;
                grid-column: auto;
            }

            `}
            </style>
    </div>
);

export default PersonalData;
